import logo from "./logo.svg";
import "./App.css";
import Footer from "./Components/Footers";
import React, { Component } from "react";
import { Nav, Navbar, NavDropdown } from "react-bootstrap";
import navbar from "./Components/Navbar";
//Non rappresenta documenti dinamicamente
//function App() {

//Funziona in modo dinamico e mi permette di mettere i props
class App extends Component {
  render() {
    return (
      <div classNameName="App">
        <Navbar></Navbar>
        <div className="content">This is a content</div>
        {/**  <Footer></Footer>*/}
        <div className="fixed-bottom">
          <div class="card-footer text-muted" bg="dark" variant="dark">
            <div class="p-3 mb-2 bg-dark text-white">
              <p class="text-muted">
                &copy;{new Date().getFullYear()} Made by Marco Vinciguerra
              </p>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
